import React from 'react'
import Footer from 'src/components/Footer/Footer'
import HeaderRegister from 'src/components/HeaderRegister/HeaderRegister'
import TitlePage from 'src/components/TitlePage/TitlePage'

export default function RegisterLayout({ children, title, titlePage }) {
  return (
    <div>
      <HeaderRegister title={title} />
      {children}
      <Footer />
      <TitlePage titlePage={titlePage} />
    </div>
  )
}
